import { Link } from "react-router-dom";

const Navbar = () => {
    // We update the Navbar to include links for the 5 required pages.
    return ( 
        <header>
            <div className="container">
                <Link to='/'>
                    <h1>ðŸ’ª Workout Tracker</h1>
                </Link>
                <nav>
                    <div className="links">
                        {/* 5 Pages Required for Phase 1 */}
                        <Link to='/'>Home</Link>
                        <Link to='/log'>Log/Dashboard</Link> {/* The Dynamic Page */}
                        <Link to='/features'>Features</Link>
                        <Link to='/about'>About</Link>
                        <Link to='/contact'>Contact</Link>
                    </div>
                </nav>
            </div>
        </header>
     );
}

export default Navbar;
